    $form_generator = new MY_Form('Patient');
    $form_generator->form_open_current_url();
    $title_dropdown = array(
        'Mr.' => 'Mr.',
        'Ms.' => 'Ms.',
        'Mrs.' => 'Mrs.',
        'Baby' => 'Baby.',
    );
    $form_generator->dropdown('Title', 'title', $title_dropdown, $default_title);
    $form_generator->input_patient_name('*Name', 'name', $default_name, 'Name of the patient');
    $form_generator->input('Other Name / Initials', 'other_name', $default_other_name, 'Other Name / Initials of the patient');
    $form_generator->input('Clinic Number', 'clinic_number', $default_clinic_number, 'Patient\'s clinic number');
    $form_generator->dropdown('*Gender', 'gender', array('Male' => 'Male', 'Female' => 'Female'), $default_gender);
    $civil_status = array(
        'Single' => 'Single',
        'Married' => 'Married',
        'Divorced' => 'Divorced',
        'Widow' => 'Widow',
        'Unknown' => 'Unknown',
    );
    $form_generator->dropdown('Civil Status', 'civil_status', $civil_status, $default_civil_status);
    $form_generator->input_date('*Date of Birth', 'date_of_birth', $default_date_of_birth, 'Date of Birth');
    $form_generator->input_nic('NIC', 'nic', $default_nic,'NNNNNNNNN[vVxX]');
    $form_generator->input('Contact telephone', 'telephone', $default_telephone, 'Contact Telephone Number');

    $form_generator->input('*Address 1', 'address_1', $default_address_1, 'eg. No32/2');
    $form_generator->input('Address 2', 'address_2', $default_address_2, 'eg. Lake Road');
