        function saveData(ops,redir) {
            var ok = '';
            if ($('#Full_Name_Registered').val() =='') { $('#fcFull_Name_Registered').addClass('fieldContError'); ok +='Name,' ; } else { $('#fcFull_Name_Registered').removeClass('fieldContError'); }
            if ($('#Gender').val() =='') { $('#fcGender').addClass('fieldContError'); ok +='Gender,' ; } else { $('#fcGender').removeClass('fieldContError'); }
            if ($('#NIC').val() !='') {
                if ( !checkNIC($('#NIC').val()) ) { $('#fcNIC').addClass('fieldContError');ok += 'NIC,'; }
                else{ $('#fcNIC').removeClass('fieldContError');  }
            }
            if ($('#Address_Street').val() =='') { $('#fcAddress_Street').addClass('fieldContError'); ok +='Address 1,' ; } else { $('#fcAddress_Street').removeClass('fieldContError'); }
            if ($('#Address_Village').val() =='') { $('#fcAddress_Village').addClass('fieldContError'); ok +='Town / Village,' ; } else { $('#fcAddress_Village').removeClass('fieldContError'); }
            if (ok!='') { $('#MDSError').show().html('Missing fields: '+ok); return;};

            if(ops !='New') {

                var presult = checkBeforeSave({data:({Personal_Title:$('#Personal_Title').val(),Full_Name_Registered:$('#Full_Name_Registered').val(),Personal_Used_Name:$('#Personal_Used_Name').val(),ClinicNo:$('#ClinicNo').val(),Gender:$('#Gender').val(),Personal_Civil_Status:$('#Personal_Civil_Status').val(),DateOfBirth:$('#DateOfBirth').val(),NIC:$('#NIC').val(),Telephone:$('#Telephone').val(),Address_Street:$('#Address_Street').val(),Address_Street1:$('#Address_Street1').val(),Address_Village:$('#Address_Village').val(),Remarks:$('#Remarks').val(),Address_DSDivision:$('#Address_DSDivision').val(),Address_District:$('#Address_District').val(),PID:$('#PID').val(),FS:$('#FS').val(),FORM:"patientForm" }),});

                if (presult) return;

            }
            $('#SaveBtn').attr('disabled','true').val('Saving..');
            var resM=$.ajax({
                url: 'include/patient_save.php?',
                global: false,
                type: 'POST',
                data:({Personal_Title:$('#Personal_Title').val(),Full_Name_Registered:$('#Full_Name_Registered').val(),Personal_Used_Name:$('#Personal_Used_Name').val(),ClinicNo:$('#ClinicNo').val(),Gender:$('#Gender').val(),Personal_Civil_Status:$('#Personal_Civil_Status').val(),DateOfBirth:$('#DateOfBirth').val(),NIC:$('#NIC').val(),Telephone:$('#Telephone').val(),Address_Street:$('#Address_Street').val(),Address_Street1:$('#Address_Street1').val(),Address_Village:$('#Address_Village').val(),Remarks:$('#Remarks').val(),Address_DSDivision:$('#Address_DSDivision').val(),Address_District:$('#Address_District').val(),PID:$('#PID').val(),FS:$('#FS').val(),FORM:"patientForm" }),
                async:false
            }).responseText;
            $('#fRes').remove();

            $('<div id=\'fRes\' title=\'Alert\'></div>').appendTo('body').html(resM);
            $('#fRes').dialog({
                width:400,
                height:130,
                autoOpen:true,
                modal: true,
                resizable:false,
                position:'center'
            });
            $('#SaveBtn').removeAttr('disabled').val('Save');
        }
